create table Airports (
	Id SERIAL PRIMARY KEY,
	Name VARCHAR,
	City VARCHAR,
	CapacityOnRunway INT,
	CapacityOnStorage INT
);

create table Planes (
	id SERIAL PRIMARY KEY,
	Name VARCHAR(50),
	Model VARCHAR(50),
	Owner VARCHAR,
	State VARCHAR,
	Location VARCHAR,
	AirportId INT REFERENCES Airports(Id),
	Capacity INT,
	LocationFromSplit INT,
	DateOfMaking DATE
);

create table Flights (
	id SERIAL PRIMARY KEY,
	Capacity INT,
	StartingCity VARCHAR,
	EndingCity VARCHAR,
	NumberOfTickets INT,
	StartingTime TIMESTAMP,
	PlaneId INT REFERENCES Planes(Id)
);

create table Pilots (
	id SERIAL PRIMARY KEY,
	Age INT,
	Gender VARCHAR(50),
	FlightId INT REFERENCES Flights(Id)
);

create table Grades (
	id SERIAL PRIMARY KEY,
	Value INT,
	Comment TEXT,
	FlightId INT REFERENCES Flights(Id),
	UserId INT REFERENCES Users(Id)
);

create table Tickets (
	id SERIAL PRIMARY KEY,
	Name VARCHAR(50),
	Price INT,
	FlightId INT REFERENCES FLights(Id),
	Type VARCHAR,
	NumberOfRow INT
);

create table Users (
	id SERIAL PRIMARY KEY,
	Name VARCHAR,
	LoyaltyCard VARCHAR
);

