--Ispis imena i modela svih aviona s kapacitetom vecim od 100

SELECT Name, Model FROM Planes p
Where p.Capacity > 100

SELECT * FROM Tickets t
WHERE t.Price > 100
AND t.Price < 200

UPDATE Tickets
SET Price = Price - (Price * 0.2)
WHERE Exists(
	SELECT 1
	FROM Flights
	WHERE Tickets.FlightId = Flights.Id
	AND Flights.NumberOfTickets < 20
)

UPDATE Planes
SET State = 'razmontiran'
WHERE Planes.Id NOT IN (
    SELECT DISTINCT PlaneId
    FROM Flights
)
AND EXTRACT(YEAR FROM AGE(current_date, Planes.DateOfMaking)) >= 20;

DELETE FROM Flights
WHERE NumberOfTickets = 0;

DELETE FROM Grades
WHERE EXISTS(
	SELECT 1
	FROM Flights
	WHERE Grades.FlightId = Flights.Id
	AND Flights.NumberOfTickets = 0
)

