SELECT COUNT(*) AS NumberOfFlights
FROM Flights
WHERE EXISTS (
    SELECT 1
    FROM Planes
    WHERE Planes.Id = Flights.PlaneId
    AND Planes.Owner = 'AirDUMP'
	AND EXTRACT (YEAR FROM Flights.StartingTime) = 2021
);

SELECT AVG(Value) AS average_value
FROM Grades
WHERE EXISTS(
	SELECT 1
	FROM Flights
	WHERE Flights.Id = Grades.FlightId
	AND EXISTS(
		SELECT 1
		FROM Planes
		WHERE Flights.PlaneId = Planes.Id
		AND Planes.Owner = 'AirDUMP'
	)
)

